import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'
import Typing from 'react-typing-animation';

class CenterTitle extends Component {

  constructor( props )
  {

    super( props );

  }

  render() {

    let { title, description, buttons } = this.props;

    return (
      <div data-component="cover-page-center">

        <div className="container-page hidden">

          <p data-title dangerouslySetInnerHTML={{ __html: title }} />
          <p data-description>{description}</p>

          <div data-container-service-buttons>

            {
              buttons && buttons[0]
              ? (
                  <Link to={ buttons[0].link }>
                    <button data-colored="big">
                      <i></i>
                      { buttons[0].title}
                    </button>
                  </Link>
              ): ""
            }

            {
              buttons && buttons[1]
              ? (
                  <Link to={ buttons[1].link }>
                    <button data-simple>{ buttons[1].title }</button>
                  </Link>
              ): ""
            }

          </div>

          <div data-container-service-flags>
            <i></i>
            <i></i>
            <i></i>
            <i></i>
          </div>

        </div>
      </div>
    );
  }
}
export default CenterTitle;
